import React, {useState, useEffect}from "react";
import axios from "axios";
import './Body.css';
const baseURL = "http://localhost:7000/doctorData/";

function Body()
{
   const [previous, setNew] = React.useState([{}]);

  React.useEffect(() => {
  axios.get(baseURL)
    .then((response) => {
      setNew(response.data);
    });
  }, []);

   if (!previous) return null;

    return (
      <div>
        <img src="slides/pic10.jpg" className="bodyImage"></img>
        {previous.map((pre) => (
          <div class="card">
            <a href="#">
              <img src={pre.image} class="card-img-top" alt="doctor photo"></img>
            </a>
            <div class="card-body">
              <h2 class="card-title">{pre.name}</h2>
              <p class="card-text"></p>
              <p class="card-text">
                <small class="text-muted">Last updated 3 mins ago</small>
              </p>
            </div>
          </div>
        ))}
      </div>
    );
}
export default Body;
